import "channels"
import jQuery from "jquery"
import "jquery-ui/ui/widgets/draggable"
import "jquery-ui/ui/widgets/droppable"
import BestInPlaceEditor from "best_in_place"
//import "./controllers"
import * as bootstrap from 'bootstrap'

Rails.start()
Turbolinks.start()
